  }
  auto iter = mObjectInstanceNameReservationCallbacks.find(theObjectInstanceName);
  if (iter != mObjectInstanceNameReservationCallbacks.end())
  {
    iter->second(true);
    mObjectInstanceNameReservationCallbacks.erase(iter);
  }
}

